import './Home.css';
import { useEffect, useState, forwardRef, useImperativeHandle } from "react";
import Button from '@mui/material//Button';
import Landing from './Landing.js';
import Table from './Table.js';
import { Link, browserRouter, Route, Routes } from 'react-router-dom'

function Home({ onLogout }) {
    const [token, setToken] = useState("")
    const logout = () => {
        setToken("")
        window.localStorage.removeItem("token")
        window.location.reload();
    }
    return (
        <div className='Home'>
            <link rel="stylesheet" href="https://use.typekit.net/lll4eml.css"></link>
            <div className='navBar'>
            <Link to='/' className='link'><p className='navBarItem'>TrackTheSpot</p></Link>
                <div className='navBarItem'>
                    <Link to='/' className='link'><p className='navBarItemMenu'>Home</p></Link>
                    <Link to='/recommendations' className='link'><p className='navBarItemMenu'>Recommendations</p></Link>
                    <Link to='/about' className='link'><p className='navBarItemMenu'>About</p></Link>
                    <Link to='/' className='link'><div onClick={logout}><p className='navBarItemMenu'>Logout</p></div></Link>
                </div>

            </div>
        </div>
    );
}

export default Home;
